def rnaToProtein(dna):
    finalProtien = ""
    for i in range(int(len(dna)/3)):
        strand = dna[i*3:i*3+3]
        if strand[0] == 'A':
            if strand[1] == 'A':
                if strand[2] == 'C' or strand[2] == 'U':
                    finalProtien += 'N'
                if strand[2] == 'A' or strand[2] == 'G':
                    finalProtien += 'K'
            if strand[1] == 'C':
                finalProtien += 'T'
            if strand[1] == 'G':
                if strand[2] == 'C' or strand[2] == 'U':
                    finalProtien += 'S'
                if strand[2] == 'A' or strand[2] == 'G':
                    finalProtien += 'R'
            if strand[1] == 'U':
                if strand[2] == 'G':
                    finalProtien += 'M'
                else:
                    finalProtien += 'I'
        if strand[0] == 'C':
            if strand[1] == 'A':
                if strand[2] == 'C' or strand[2] == 'U':
                    finalProtien += 'H'
                if strand[2] == 'A' or strand[2] == 'G':
                    finalProtien += 'Q'
            if strand[1] == 'C':
                finalProtien += 'P'
            if strand[1] == 'G':
                finalProtien += 'R'
            if strand[1] == 'U':
                finalProtien += 'L'
        if strand[0] == 'U':
            if strand[1] == 'A':
                if strand[2] == 'C' or strand[2] == 'U':
                    finalProtien += 'Y'
                if strand[2] == 'A' or strand[2] == 'G':
                    return finalProtien #stop
            if strand[1] == 'C':
                finalProtien += 'S'
            if strand[1] == 'G':
                if strand[2] == 'C' or strand[2] == 'U':
                    finalProtien += 'C'
                if strand[2] == 'G':
                    finalProtien += 'W'
                if strand[2] == 'A':
                    return finalProtien  # stop
            if strand[1] == 'U':
                if strand[2] == 'C' or strand[2] == 'U':
                    finalProtien += 'F'
                if strand[2] == 'A' or strand[2] == 'G':
                    finalProtien += 'L'
        if strand[0] == 'G':
            if strand[1] == 'A':
                if strand[2] == 'C' or strand[2] == 'U':
                    finalProtien += 'D'
                if strand[2] == 'A' or strand[2] == 'G':
                    finalProtien += 'E'
            if strand[1] == 'C':
                finalProtien += 'A'
            if strand[1] == 'G':
                finalProtien += 'G'
            if strand[1] == 'U':
                finalProtien += 'V'
    return finalProtien

